// src/pages/Navigation.js
import React, { useEffect, useRef } from 'react';
import { Container, Typography, Paper, Select, MenuItem, TextField, Button } from '@mui/material';
import { Box } from '@mui/system';
import { EventHandlingModule } from '../modules/EventHandlingModule';

export const Navigation = () => {
  const scrollRef = useRef(null);
  const progbarRef = useRef(null);

  useEffect(() => {
    // Wait for refs to be available
    if (scrollRef.current && progbarRef.current) {
      // Set up scroll handler
      scrollRef.current.onscroll = EventHandlingModule.updateSliderValue;

      // Set up progress bar handler
      progbarRef.current.oninput = () => window.updateAgent?.();
    }

    // Cleanup
    return () => {
      if (scrollRef.current) {
        scrollRef.current.onscroll = null;
      }
      if (progbarRef.current) {
        progbarRef.current.oninput = null;
      }
    };
  }, []);

  return (
    <Container>
      <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
        {/* Theme Selector */}
        <Select 
          defaultValue="light"
          id="theme-dropdown"
          size="small"
          sx={{ width: 200, alignSelf: 'flex-end' }}
        >
          <MenuItem value="light">Default</MenuItem>
          <MenuItem value="dark">Dark</MenuItem>
          <MenuItem value="secondary">Secondary</MenuItem>
          <MenuItem value="winter">Winter</MenuItem>
        </Select>

        {/* Title Section */}
        <Box sx={{ textAlign: 'center', mb: 2 }}>
          <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'center', gap: 2 }}>
            <img 
              id="titleicon"
              style={{ width: 100, height: 'auto' }}
              src={process.env.PUBLIC_URL + '/hseapps.0051872e.png'}
              alt="HseAPPS Logo"
            />
            <Typography variant="h3">HSE Maps</Typography>
          </Box>
        </Box>

        {/* Navigation Inputs */}
        <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2, alignItems: 'center' }}>
          <Box sx={{ display: 'flex', gap: 2, flexWrap: 'wrap', justifyContent: 'center' }}>
            <TextField
              id="start"
              placeholder="Start"
              variant="outlined"
              size="small"
            />
            <TextField
              id="end"
              placeholder="Destination"
              variant="outlined"
              size="small"
            />
          </Box>
          <Button 
            variant="contained" 
            onClick={() => window.markShortestPathFromInput()}
          >
            Route
          </Button>
        </Box>

        {/* Map Container */}
        <Box id="svgdiv" sx={{ position: 'relative' }}>
          <div id="scroll" ref={scrollRef}><div></div></div>
          <svg 
            id="svg" 
            xmlns="http://www.w3.org/2000/svg" 
            xmlnsXlink="http://www.w3.org/1999/xlink" 
            version="1.1" 
            viewBox="0 0 0 0"
          >
            <g>
              <g id="svgraph">
                <g>
                  <image
                    id="map"
                    width="2048"
                    height="1308"
                    preserveAspectRatio="none"
                    xlinkHref="../src/elements/mainfloorcrunched.png"
                  />
                  <g id="graph"></g>
                </g>
              </g>
            </g>
          </svg>
        </Box>

        {/* Progress Bar */}
        <Box id="progbarcontainer" sx={{ width: '100%' }}>
          <input
            ref={progbarRef}
            title="Progress"
            type="range"
            min="0"
            max="200"
            defaultValue="0"
            id="progbar"
            style={{ width: '100%' }}
          />
        </Box>

        {/* Schedule Section */}
        <Box id="schedulecontainer" sx={{ display: 'flex', gap: 2, justifyContent: 'center' }}>
          <TextField
            id="sched"
            title="Schedule"
            variant="outlined"
            size="small"
          />
          <Button 
            variant="contained"
            onClick={() => window.navSchedule()}
          >
            Schedule
          </Button>
        </Box>
      </Box>
    </Container>
  );
};
